-- ■[追加] SEQUENCE
-- ■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■
CREATE SEQUENCE seq_m_user_id START WITH 1 increment BY 1 maxvalue 99999999; 
CREATE SEQUENCE seq_m_role_id START WITH 1 increment BY 1 maxvalue 99999999; 
CREATE SEQUENCE seq_m_system_thema_id START WITH 1 increment BY 1 maxvalue 99999999; 

-- ■[追加] TABLE
-- ■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■■
CREATE TABLE m_user ( 
	id INTEGER NOT NULL DEFAULT NEXTVAL('seq_m_user_id')
    , update_cnt INTEGER NOT NULL
	, user_id VARCHAR (100) NOT NULL
	, password VARCHAR (255) NOT NULL
	, role_cd VARCHAR (50) NOT NULL
	, user_nm VARCHAR (20) NOT NULL
    , account_expiration DATE NOT NULL
    , password_expiration DATE NOT NULL
	, enabled BOOLEAN NOT NULL
	, insert_user_id VARCHAR (100) NOT NULL
	, insert_timestamp TIMESTAMP NOT NULL
	, update_user_id VARCHAR (100)
	, update_timestamp TIMESTAMP
	, PRIMARY KEY (user_id)
); 
CREATE TABLE m_user_detail ( 
    update_cnt INTEGER NOT NULL
	, user_id VARCHAR (100) NOT NULL
	, last_nm VARCHAR (100)
	, first_nm VARCHAR (100)
	, last_nm_kana VARCHAR (100)
	, first_nm_kana VARCHAR (100)
	, gender VARCHAR (10) NOT NULL
	, phone_no VARCHAR (15)
	, mobile_phone_no VARCHAR (15)
	, mail_address VARCHAR (100)
	, post_no VARCHAR (8)
	, prefecture VARCHAR (10)
	, address VARCHAR (100)
	, address_kana VARCHAR (100)
	, date_of_birth DATE
	, blood_type VARCHAR (2)
	, system_thema_cd VARCHAR (30) NOT NULL
	, insert_user_id VARCHAR (100) NOT NULL
	, insert_timestamp TIMESTAMP NOT NULL
	, update_user_id VARCHAR (100)
	, update_timestamp TIMESTAMP
	, PRIMARY KEY (user_id)
); 
CREATE TABLE m_role ( 
	id INTEGER NOT NULL DEFAULT NEXTVAL('seq_m_role_id')
    , update_cnt INTEGER NOT NULL
	, role_cd VARCHAR (50) NOT NULL
	, role_nm VARCHAR (100) NOT NULL
    , order_no INTEGER NOT NULL
	, enabled BOOLEAN NOT NULL
	, insert_user_id VARCHAR (100) NOT NULL
	, insert_timestamp TIMESTAMP NOT NULL
	, update_user_id VARCHAR (100)
	, update_timestamp TIMESTAMP
	, PRIMARY KEY (role_cd)
); 
CREATE TABLE m_system_thema ( 
	id INTEGER NOT NULL DEFAULT NEXTVAL('seq_m_system_thema_id')
    , update_cnt INTEGER NOT NULL
	, system_thema_cd VARCHAR (50) NOT NULL
	, system_thema_nm VARCHAR (100) NOT NULL
    , order_no INTEGER NOT NULL
	, enabled BOOLEAN NOT NULL
	, insert_user_id VARCHAR (100) NOT NULL
	, insert_timestamp TIMESTAMP NOT NULL
	, update_user_id VARCHAR (100)
	, update_timestamp TIMESTAMP
	, PRIMARY KEY (system_thema_cd)
); 
